//Actions
const GET_TODOS = "components/Todo/GET_TODOS";

//Reducer
const todoReducer = function(state = [], action) {
  switch (action.type) {
    case "GET_TODOS":
      console.log(action);
      return action.todos;
    default:
      return state;
  }
};

//Action Creators

